# -*- coding: utf-8 -*-
from PyQt6 import QtGui
import base64

ON_BUTTON = '' #noqa

OFF_BUTTON = ''  #noqa

IMAGE_TABLE = {'ON_BUTTON' : ON_BUTTON, 'OFF_BUTTON' : OFF_BUTTON}

def load(data : str) -> QtGui.QIcon:
    pm = QtGui.QPixmap()
    pm.loadFromData(base64.b64decode(IMAGE_TABLE[data]))
    return QtGui.QIcon(pm)
